import React from "react";
import ReactDOM from "react-dom";

let mainStyles = {
  display: 'flex',
  backgroundColor: 'green'
}

let width = {
  width: '35%',
  miWidth: '300px'
}

ReactDOM.render(<App />, document.getElementById("root"));

function App() {
  return (
    <main>
      <Panes>
        <Pane width={'35%'} minWidth={'300px'}>hello</Pane>
        <Pane width={'65%'}>world</Pane>
      </Panes>
    </main>
  )
}

function Panes(props) {
  return <div style={mainStyles}>{props.children}</div>
}

function Pane(props) {
  return <div style={width}>{props.children}</div>
}
